import React, { Component } from "react";

class ShirtCard extends Component {
  render() {
    const { car } = this.props;

    // Check if car is defined
    if (!car) {
      return <div>No car data available.</div>;
    }

    return (
      <div>
        <p>Price: {car.price}</p>
        {/* Render other car details as needed */}
      </div>
    );
  }
}

export default ShirtCard;
